  true,\n\t\"url\": null,\n\t\"notes\": \"The GPM Ground Validation McGill Vertical
  Pointing X-Band (VertiX) Radar GCPEx dataset was collected from January 15, 2012
  to February 29, 2012 at the CARE site in Ontario, Canada as a part of the GPM Cold-season
  Precipitation Experiment (GCPEx).  The VertiX, a vertically pointing X-band radar,
  can detect all precipitation targets and some ice clouds.  The VertiX can also measure
  the Doppler velocity of precipitation targets.  The GPM Ground Validation McGill
  Vertical Pointing X-Band (VertiX) Radar GCPEx dataset is available in netCDF format.\",\n\t\"license_title\":
